import createReactComponent from '../createReactComponent';
var Clock9 = createReactComponent('Clock9', [['circle', {
  cx: '12',
  cy: '12',
  r: '10',
  key: '1mglay'
}], ['polyline', {
  points: '12 6 12 12 7.5 12',
  key: '1k60p0'
}]]);
export default Clock9;
